【カリー屋 コクデミカレーの詳細】<br>
オリジナルにブレンドした29種類のスパイスの香りと、デミグラスソースの濃厚なコクが溶け込んだ、奥深い味わいのビーフカレーです。<br><br>

【作り方】<br>
●中袋(レトルトパウチ)の封を切らずに、熱湯の中に入れ、3～5分沸騰させます。<br>
●電子レンジの場合：必ず深めの皿に移し替えてラップをかけて温めます。<br>
※中袋のまま電子レンジには入れないでください。<br>
※加熱時間は、機種・W(ワット)数により異なりますので、加減してください。<br>
※開封した際に水分が分離している場合がありますが、品質に問題はありません。<br>
※冷蔵庫など温度の低い場所で保存すると水分が分離しやすくなります。<br><br>

【ご注意】<br>
○やけどに注意。ラップを取る際には、顔を近づけないでください。<br>
○中袋の開封後は1回で使いきってください。未開封であれば、もう一度温め直しても召しあがれます。<br>
○この製品はレトルトパウチ食品ですので、保存料は使用しておりません。室温で長期間保存できます。<br><br>

【原材料】<br>
野菜(じゃがいも、にんじん)、牛脂豚脂混合油、小麦粉、牛肉、砂糖・ぶどう糖果糖液糖、カレーパウダー、トマトペースト、食塩、でんぷん、みそ、オニオンパウダー、デミグラス風ソース、酵母エキス、ガーリックペースト、酵母エキス加工品、香辛料、ガーリックパウダー、チキンブイヨン、調味料(アミノ酸等)、カラメル色素、酸味料、香料、香辛料抽出物、甘味料(スクラロース)<br><br>

【栄養成分】1人分(200g)あたり<br>
エネルギー：180kcaL、たん白質：4.4g、脂質：9.4g、炭水化物：19.4g、ナトリウム：1.2g、食塩相当量：3.1g<br><br>

【アレルギー物質】<br>
小麦、牛肉、大豆、鶏肉<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
200g×10個<br><br>

【販売元】<br>
ハウス食品株式会社<br>
大阪府東大阪市御厨栄町1-5-7<br>
お電話：0120-50-1231<br><br>

