※中袋のまま電子レンジには入れないでください。<br>
※加熱時間は、機種・W(ワット)数、ごはんの温度・量により異なりますので、加減してください。<br>
※開封した際に水分が分離している場合がありますが、品質に問題はありません。<br>
※冷蔵庫など温度の低い場所で保存すると水分が分離しやすくなります。<br><br>

【ご注意】<br>
○やけどに注意。ラップを取る際には、顔を近づけないでください。<br>
○中袋の開封後は1回で使いきってください。未開封であれば、もう一度温め直しても召しあがれます。<br>
○この製品はレトルトパウチ食品ですので、保存料は使用しておりません。室温で長期間保存できます。<br><br>

【原材料】<br>
野菜(じゃがいも、にんじん)、小麦粉、牛肉、牛脂豚脂混合油、砂糖、トマトペースト、カレーパウダー、食塩、ココナッツペースト、でんぷん、りんごペースト、ソテーオニオン、ぶどう糖、酵母エキス、香辛料、しょう油、オニオンパウダー、ガーリックパウダー、チキンブイヨン、調味料(アミノ酸等)、カラメル色素、酸味料、香料、(原材料の一部に乳成分を含む)<br><br>

