【完熟トマトのハヤシライスソースの詳細】<br>
完熟トマトの濃厚なうまみと甘み、ほどよい酸味が特徴のまろやかなハヤシライスソースです。（トマトはパウダーとペーストを使用）<br><br>

【作り方】<br>
1.中火：厚手の鍋にサラファ油を熱し、玉ねぎをしんなりするまで炒め、さらに3-4cm幅に切った牛肉を加えて炒める。<br>
2.弱火-中火：あくを取り、煮込む。（沸騰後約15分）<br>
3.火を止める：ルウを割り入れて溶かす。<br>
4.弱火：時々かき混ぜながら再び煮込む。（約10分）<br>
※牛肉の代わりに豚肉を使用してもおいしく召し上がれます。<br><br>

【ご注意】<br>
○保存方法：直射日光を避け、湿気が少なく涼しい場所で保存してください。<br>
○ルウが柔らかくなることや、変形、変色することがあるので、なるべく高温化には置かないでください。<br>
○フィルム開封後のルウは、密封容器などに入れて、冷蔵庫で保存し、早めにお使いください。<br><br>

【原材料】<br>
食用油脂(牛脂豚脂混合油、パーム油)、砂糖、小麦粉、でんぷん、食塩、トマトパウダー、調味油、トマトペースト、トマトケチャップ風調味料、香辛料、ぶどう糖、ソテー野菜ペースト、粉末ソース、オニオンパウダー、トマトエキス、酵母エキス、脱脂大豆、ローストオニオンパウダー、チキンエキス、玉ねぎエキス、着色料(カラメル、パプリカ色素)、調味料(アミノ酸等)、乳化剤、酸味料、香料、香辛料抽出物、(原材料の一部に乳成分、ゼラチンを含む)<br><br>

【栄養成分】1皿分(製品18.4g)あたり<br>
エネルギー：84kcaL、たん白質：0.68g、脂質：6.1g、炭水化物：9.0g、ナトリウム：790mg、食塩相当量：2.0g<br><br>

【アレルギー物質】
乳成分、小麦、大豆、鶏肉、豚肉、ゼラチン<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
184g×10個<br><br>

